def minPath(grid, k):
    n = len(grid)
    start = min(min(row) for row in grid)
    path = [start]
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]

    def dfs(i, j, visited):
        if len(path) == k:
            return True
        for dx, dy in directions:
            x, y = i + dx, j + dy
            if 0 <= x < n and 0 <= y < n and (x, y) not in visited:
                path.append(grid[x][y])
                visited.add((x, y))
                if dfs(x, y, visited):
                    return True
                path.pop()
                visited.remove((x, y))
        return False

    for i in range(n):
        for j in range(n):
            if grid[i][j] == start:
                visited = {(i, j)}
                if dfs(i, j, visited):
                    return path

