    return x if is_prime(n) else y

def Strongest_Extension(class_name, extensions):
    def strength(extension):
        return extension.count('A') + extension.count('B') + extension.count('C') - extension.count('a') - extension.count('b') - extension.count('c')

    max_strength = float('-inf')
    strongest_extension = ''

    for extension in extensions:
        current_strength = strength(extension)
        if current_strength > max_strength:
            max_strength = current_strength
            strongest_extension = extension

    return f"{class_name}.{strongest_extension}"

def even_odd_count(num):
    even_count = len([digit for digit in str(abs(num)) if int(digit) % 2 == 0])
    odd_count = len([digit for digit in str(abs(num)) if int(digit) % 2 != 0])
    return (even_count, odd_count)

def int_to_mini_roman(number):
    roman_numerals = {
        1000: 'm', 900: 'cm', 500: 'd', 400: 'cd',
        100: 'c', 90: 'xc', 50: 'l', 40: 'xl',
        10: 'x', 9: 'ix', 5: 'v', 4: 'iv', 1: 'i'
    }

    result = ''
    for value, numeral in roman_numerals.items():
        while number >= value:
            result += numeral
            number -= value

    return result

def find_max(words):
    max_unique_chars = 0
    max_word = ""

    for word in words:
        unique_chars = len(set(word))
        if unique_chars > max_unique_chars or (unique_chars == max_unique_chars and word < max_word):
            max_unique_chars = unique_chars
            max_word = word

    return max_word

def do_algebra(operator, operand):
    expression = str(operand[0])
    for i in range(len(operator)):
        expression += operator[i] + str(operand[i+1])
    return eval(expression)

import hashlib

def string_to_md5(text):
    if not text:
        return None
    return hashlib.md5(text.encode()).hexdigest()
